import React, { Component } from "react";
import "./signin.css";
//import tachyons from "tachyons";

const Signin = function ({onRouteChange}){
    return(
        <main className="container">
            <div className="inner-container">
                <div className="email"><input type="email" placeholder="Email" /></div>
                <div className="password"><input type= "password" placeholder="password"></input></div>
                <div className="button"><button onClick={onRouteChange}>Sign in</button></div>
            </div>
        </main>
    ) 
};

export default Signin;
